void prepareString(char* str)
{
    const int sl = strlen(str);
    // replace commas with spaces
    for (int i = 0; i < sl; ++i)
        if (str[i] == ',')
            str[i] = ' ';

    // replace trailing ')' with space
    if (str[sl - 1] == ')')
        str[sl - 1] = ' ';
}

