char* parse_single_quoted_string(char* in, char* out, size_t out_size)
{
    --out_size;
    size_t out_cnt = 0;

    char* const orig_in = in;
    in = strchr(in, '\'');

    if (!in)
    {
        *out = 0;
        return orig_in;
    }

    ++in;

    char c;
    while (out_cnt < out_size && (c = *in++))
    {
        if (c == '\'')
            break;

        if ((c == '\\') && !(c = *in++))
            break;

        *out++ = c;
        ++out_cnt;
    }

    *out = 0;

    return in;
}


